import React from "react";
import CustomizedForm from "./customizedForm";
import { Modal, Form, Input, Radio } from "antd";

const CustomModal = ({ visible, onhandleAdd, onCancel, data }) => {
  const [form] = Form.useForm();
  return (
    <Modal
      visible={visible}
      title="Edit a new collection"
      okText="Edit"
      cancelText="Cancel"
      onCancel={onCancel}
      onOk={() => {
        form
          .validateFields()
          .then(values => {
            form.resetFields();
            onhandleAdd(values);
          })
          .catch(info => {
            console.log("Validate Failed:", info);
          });
      }}
    >
      <CustomizedForm form={form} data={data} />
    </Modal>
  );
};

export default CustomModal;
